import React from 'react'
import { Link } from 'react-router-dom'
import edailogo from '../EdAI Logo.png'

const LandingPage = () => {
  return (
    <div>
      <div id='LP-Header'>
        <img id="logo" src={edailogo} alt="Logo" />
      </div>
      <Link to='/LoginSignUp'>LogIn/SignUp</Link>

    </div>
  )
}

export default LandingPage;
